    constructor(props){
        super(props);
    }

    render() {

        return(

            <ReactPlayer url='https://www.youtube.com/watch?v=ysz5S6PUM-U' controls playing='true' light='https://image.noelshack.com/fichiers/2020/12/5/1584732752-yagami-light.jpg'/>
        
        );
    }
}
